qStringExpression.qExpr:
if(count(distinct UUID) = 1, 
	if( [Number of Captures] = 1, 'From ' & [Collection Title], 
    	('From ' & [Collection Title] & ', 1st image of ' & [Number of Captures] & ' available at NYPL.org')
        ),
    'Images: ' & count(distinct UUID)
   )

qDef.qDef:
if(count(UUID) = 1,
	If([Title] <> '', [Title], 'UUID: ' & UUID),
    'Select a single image to see details'
)

if(count(UUID) = 1,
	If([Place Of Publication] <> '', 'Place Of Publication: ' & [Place Of Publication])
)
